import React from 'react'
import '../css/Navigation.css'

export const Navigation = () => {
    return (
        <div className='nav'>
            <a>Home</a>
            <a>About</a>
            <a>Skills</a>
            <a>Experience</a>
            <a>Portfolio</a>
        </div>
    )
}
export default Navigation;
